window.bookSummaryJSON = "<p>Justin Trimble's fantasies come to life when a couple of sexy, middle-aged professors give his virtual world a try and are transformed both in-game and out.</p> <p>As an AI researcher, Justin Trimble already has access to some of the most advanced technology on the planet. On his nights and weekends, he explores the capabilities of the virtual systems to invent an immersive game. To make the game more appealing, he modifies the immersion rigs to stimulate pleasure as reward for achievements. Coupling that with game mechanics that allow players to share intimate moments and he's got a recipe for gameplay that's exciting on many levels.</p> <p>What Justin doesn't know, however, is that in modifying the rigs, some of the changes he's put into the game follow players back to the real world. These changes aren't that big of a deal until one night, his thesis advisor, a woman who he's secretly fantasized about for years, decides to join him in game. Against advice, she chooses to play a half-orc, a race that has few inhibition's about sexual expression.</p> <p><i>Monster Girls Unlocked</i> is an exciting harem adventure that explores relationships with chubby MILFs and exciting coeds.</p> <p><b>A word of warning:</b> This story will get your heart pounding with unconventional relationships and detailed descriptions intimate relationships both in-game and out. If you don't like that kind of thing, don't listen to this audiobook.</p>"; 
